import{_ as e,o as l,c as i,a}from"./app.ba574bda.js";const g=JSON.parse('{"title":"Changelog","description":"Updates List","frontmatter":{"title":"Changelog","description":"Updates List","layout":"doc"},"headers":[{"level":3,"title":"17. Nov 2022","slug":"_17-nov-2022","link":"#_17-nov-2022","children":[]},{"level":3,"title":"20. Nov 2022","slug":"_20-nov-2022","link":"#_20-nov-2022","children":[]},{"level":3,"title":"24. Nov 2022","slug":"_24-nov-2022","link":"#_24-nov-2022","children":[]},{"level":3,"title":"25. Nov 2022","slug":"_25-nov-2022","link":"#_25-nov-2022","children":[]},{"level":3,"title":"01. Dec 2022","slug":"_01-dec-2022","link":"#_01-dec-2022","children":[]},{"level":3,"title":"15. Dec 2022","slug":"_15-dec-2022","link":"#_15-dec-2022","children":[]},{"level":3,"title":"16. Dec 2022","slug":"_16-dec-2022","link":"#_16-dec-2022","children":[]},{"level":3,"title":"17. Dec 2022","slug":"_17-dec-2022","link":"#_17-dec-2022","children":[]},{"level":3,"title":"19. Dec 2022","slug":"_19-dec-2022","link":"#_19-dec-2022","children":[]},{"level":3,"title":"09. Jan 2023","slug":"_09-jan-2023","link":"#_09-jan-2023","children":[]}],"relativePath":"changelog.md"}'),t={name:"changelog.md"},o=a('<h1 id="changelog" tabindex="-1">Changelog <a class="header-anchor" href="#changelog" aria-hidden="true">#</a></h1><h3 id="_17-nov-2022" tabindex="-1">17. Nov 2022 <a class="header-anchor" href="#_17-nov-2022" aria-hidden="true">#</a></h3><ul><li>Images - Face Restoration Page <ul><li>Remove duplicate examples</li><li>Add CodeFormer</li><li>Add additional woman example</li></ul></li><li>Add Changelog Page</li></ul><h3 id="_20-nov-2022" tabindex="-1">20. Nov 2022 <a class="header-anchor" href="#_20-nov-2022" aria-hidden="true">#</a></h3><ul><li>Images - Add Denoise Page <ul><li>Add Directions example</li><li>Add Stefantiek example</li></ul></li></ul><h3 id="_24-nov-2022" tabindex="-1">24. Nov 2022 <a class="header-anchor" href="#_24-nov-2022" aria-hidden="true">#</a></h3><ul><li>Images - Add Deblurring Page <ul><li>Add three GoPro examples</li></ul></li><li>Add Image Files Links for Deblurring, Denoise, Face Restoration and Favorites Page in details</li></ul><h3 id="_25-nov-2022" tabindex="-1">25. Nov 2022 <a class="header-anchor" href="#_25-nov-2022" aria-hidden="true">#</a></h3><ul><li>Images - Update Deblurring Page <ul><li>Add DeblurGANv2_MobileNet</li><li>Add DeblurGANv2_InceptionResNet-v2</li></ul></li></ul><h3 id="_01-dec-2022" tabindex="-1">01. Dec 2022 <a class="header-anchor" href="#_01-dec-2022" aria-hidden="true">#</a></h3><ul><li>Images - Update Multimodel Page with <a href="./multimodels.html#set-5">Set 5</a><ul><li>Add Set 5 Photo <a href="./multimodels.html#buddy-2">Buddy example</a><ul><li>Add HAT versions, Real_HAT_GAN_SRx4 was just released a week ago on 24 Nov 2022</li><li>Add Swin2SR versions which released 27 Sept 2022</li><li>Add FeMaSE which released Oct 2022</li><li>Add LBNet which released Mai 2022</li><li>Add Poll (Voting for best results)</li><li>P.S. just as info &quot;ruDALL-E-SR&quot; is the re-trained version of Real-ESRGAN with custom dataset by Igor Pavlov which is used by ruDALL-E <a href="https://github.com/chenxwh/rudalle-sr" target="_blank" rel="noreferrer">Repo1</a> <a href="https://github.com/ai-forever/Real-ESRGAN" target="_blank" rel="noreferrer">Repo2</a> <a href="https://drive.google.com/drive/folders/16PlVKhTNkSyWFx52RPb2hXPIQveNGbxS" target="_blank" rel="noreferrer">Model</a></li></ul></li><li>Add Community Top 5 page template</li><li>Add Set 5 Photo <a href="./multimodels.html#grosser-mythen">Grosser Mythen example</a></li><li>Add Set 5 Photo <a href="./multimodels.html#painting-1">Painting example</a></li><li>Add Set 5 Photo <a href="./multimodels.html#pc-build-1">PC Build example</a></li><li>Add Set 5 Photo <a href="./multimodels.html#snowboard">Snowboard example</a></li></ul></li></ul><h3 id="_15-dec-2022" tabindex="-1">15. Dec 2022 <a class="header-anchor" href="#_15-dec-2022" aria-hidden="true">#</a></h3><ul><li>Images - Update Multimodels Page <ul><li>Restructure Page, current (now updatable) examples on Top</li><li>Current examples redone in own Vue Image comparison component with vue select and fore rerender component when selection happens so that multi-image comparison is possible. The list is built by traversing the folders with nodejs and saving filenames and paths in a data.json file so the frontend can use it on page load, the images get bundled with the application. Now I can simply manage files and these examples will keep themselves updated with each new build (drag&amp;dropping 300+ images through the imgsli website to update a single example is now in the past). With the new comparison component it is simpler to drag the image around than to try to hit the middle slider to move it around. With the mouse wheel one can zoom in up to a hardcoded limit.</li><li>Added AI Generated Images examples with vue component</li><li>Added Anime examples with the vue component. Models from the &#39;Anime&#39; Section in the Upscale Wiki Model Database have been used additionally.</li></ul></li><li>Images - Remove single model pages</li><li>Images - Models used page is now also automatically generated thorugh traversing files in some example directories since I generally named the output files according to the model used</li><li>Images - update all examples from imgsli to new local vue component</li><li>Images - Bundle all image sources files inside the app</li></ul><h3 id="_16-dec-2022" tabindex="-1">16. Dec 2022 <a class="header-anchor" href="#_16-dec-2022" aria-hidden="true">#</a></h3><ul><li><p>Images - Multimodels</p><ul><li>Replace anime example source files.</li></ul><p>Based on feedback, I had overdone it with image compression (mozjpeg) (for page speed reasons) which led to artifacts appearing on all images. Reverted those back to the original jpg 100% output files I still have, additionally compressed with fileoptimizer. Will need to do the same for the other examples. I might redo all the upscales, but with a lossless image format output (either PNG (together with oxiPNG maybe or fileoptimizer again) or WEBP Lossless).</p></li></ul><h3 id="_17-dec-2022" tabindex="-1">17. Dec 2022 <a class="header-anchor" href="#_17-dec-2022" aria-hidden="true">#</a></h3><ul><li>Images - Multimodels <ul><li>Replace photo and ai-generated example source files.</li><li>Fix file links (input and output source files) for these examples</li></ul></li></ul><h3 id="_19-dec-2022" tabindex="-1">19. Dec 2022 <a class="header-anchor" href="#_19-dec-2022" aria-hidden="true">#</a></h3><ul><li>Externalize image source files, not bundled into app anymore but load directly from github folders through github links (reduce bundle size because of github pages artifacts size limit (deploy abort because of timeout error) and also bundle/deploy times (shot up from ~8 min to &gt;30min when bundling image sources) reduction). Also important if more files are added in the future. For the externalized sources folder the image sources files have been re-imported from commit 70420bd136c31e26c6bba8cf19e8d630848dc67e to make sure the image files are from before I had bundled and overdone it with compression (so to get the output files I got when running chaiNNer with JPG 100% output, still lossy though since jpg format) - added anime examples from later states again <ul><li>Adapt component, load files from github links (<a href="http://raw.githubusercontent.com" target="_blank" rel="noreferrer">raw.githubusercontent.com</a>)</li><li>Adapt source links for examples (externalized source folder)</li></ul></li></ul><h3 id="_09-jan-2023" tabindex="-1">09. Jan 2023 <a class="header-anchor" href="#_09-jan-2023" aria-hidden="true">#</a></h3><ul><li>Images - Favorites page update <ul><li>Lossless examples with models selection, with fullscreen and reset button</li><li>Add simple reccommendation per example for an upscaling model to use</li></ul></li></ul>',21),d=[o];function n(r,s,h,u,c,m){return l(),i("div",null,d)}const f=e(t,[["render",n]]);export{g as __pageData,f as default};
